  <script type="text/javascript">    
 function ThumbnailPlot(plot) {              
 <!-- clear_l()-->                    
 document.getElementById("thumblink_l").href = plot     
 document.getElementById("thumb_l").src = plot          
 document.getElementById("thumb_l").width = " 700 "   
 document.getElementById("thumb_l").height = " 500 "    
 document.getElementById("thumb_l").border = "1"      
 }    
 function clear_l() {      
 document.getElementById("thumblink_l").href = "#"   
 document.getElementById("thumb_l").src = ""         
 document.getElementById("thumb_l").width = "0"      
 document.getElementById("thumb_l").height = "0"     
 document.getElementById("thumb_l").border = "0"     
 }     
function ThumbnailNote(flag,id) { 
if (flag=="1"){ 
if( document.layers) document.all[''+id+''].visibility = "show" 
else if ( document.all) document.all[''+id+''].visibility = "visible" 
else if ( document.getElementById) document.getElementById(''+id+'').style.visibility = "visible" 
}
  else 
 if( flag=="0"){ 
 if( document.layers) document.all[''+id+''].visibility = "hide" 
else if ( document.all) document.all[''+id+''].visibility = "hidden" 
else if ( document.getElementById) document.getElementById(''+id+'').style.visibility = "hidden" 
} 
}
